(function(win) {
	win.szqbl = win.szqbl || {};
	win.szqbl.log = {};
	win.szqbl.log.browseMUI = function(data) {
		var d = mui.extend(data, {});
		mui.ajax(szqbl.getHttp('api/log/browse/add.do'), {
			data : d,
			type : 'post',
			timeout : 5000,
			success : function(data) {},
			error : function(xhr, type, errorThrown) {}
		});
	};
	win.szqbl.log.browseJQ = function(data) {
		var d = $.extend(data, {});
		$.ajax(szqbl.getHttp('api/log/browse/add.do'), {
			data : d,
			type : 'post',
			timeout : 5000,
			success : function(data) {},
			error : function(xhr, type, errorThrown) {}
		});
	};
	win.szqbl.log.browse = function() {
		var data = {
			pageUrl : location.href,
			pageTitle : document.title,
			typeName : "未分类",
			keyId : "未知",
			keyParId : "未知",
			userId : szqbl.user.id,
			resolution : document.body.clientHeight + "x" + document.body.clientWidth
		}

		if (mui) {
			win.szqbl.log.browseMUI(data);
		} else {
			win.szqbl.log.browseJQ(data);
		}
	};
	win.szqbl.log.browse();
}(window));